@-moz-document domain("fileinfo.com") {
/* Change the background color to red */
  body {
    background-color: #FF9292 !important;
  }

  /* Change specific elements to red */
  .element-class {
    color: #FF9292 !important;
  }
  
  /* Change links to red */
  a {
    color: #FF9292 !important;
  }
}
